@RestController
@RequestMapping("/api/orders")
@RequiredArgsConstructor
@Slf4j
public class OrderController {

    private final OrderService orderService;

    @PostMapping
    public ResponseEntity<Order> createOrder(@RequestBody CreateOrderRequestDTO request) {
        log.info("Creating order for user: {} with products: {}", request.getUserId(), request.getProductIds());

        try {
            Order order = orderService.createOrder(
                    request.getUserId(), 
                    request.getProductIds(), 
                    request.getQuantities()
            );
            return ResponseEntity.ok(order);
        } catch (Exception e) {
            log.error("Error creating order: {}", e.getMessage());
            return ResponseEntity.badRequest().build();
        }
    }

    @PutMapping("/{orderId}/status")
    public ResponseEntity<Order> updateOrderStatus(@PathVariable Long orderId, 
                                                  @RequestBody Map<String, String> request) {
        log.info("Updating order status for order: {} to {}", orderId, request.get("status"));

        try {
            Order.OrderStatus status = Order.OrderStatus.valueOf(request.get("status"));
            Order order = orderService.updateOrderStatus(orderId, status);
            return ResponseEntity.ok(order);
        } catch (Exception e) {
            log.error("Error updating order status: {}", e.getMessage());
            return ResponseEntity.badRequest().build();
        }
    }

    @PutMapping("/{orderId}/payment")
    public ResponseEntity<Order> processPayment(@PathVariable Long orderId, 
                                               @RequestBody Map<String, String> request) {
        log.info("Processing payment for order: {} with status: {}", orderId, request.get("paymentStatus"));

        try {
            Order.PaymentStatus paymentStatus = Order.PaymentStatus.valueOf(request.get("paymentStatus"));
            Order order = orderService.processPayment(orderId, paymentStatus);
            return ResponseEntity.ok(order);
        } catch (Exception e) {
            log.error("Error processing payment: {}", e.getMessage());
            return ResponseEntity.badRequest().build();
        }
    }

    @GetMapping("/user/{userId}")
    public ResponseEntity<List<Order>> getOrdersByUser(@PathVariable Long userId) {
        log.info("Getting orders for user: {}", userId);

        List<Order> orders = orderService.getOrdersByUser(userId);
        return ResponseEntity.ok(orders);
    }

    @GetMapping("/status/{status}")
    public ResponseEntity<List<Order>> getOrdersByStatus(@PathVariable String status) {
        log.info("Getting orders with status: {}", status);

        try {
            Order.OrderStatus orderStatus = Order.OrderStatus.valueOf(status);
            List<Order> orders = orderService.getOrdersByStatus(orderStatus);
            return ResponseEntity.ok(orders);
        } catch (Exception e) {
            log.error("Error getting orders by status: {}", e.getMessage());
            return ResponseEntity.badRequest().build();
        }
    }

    @GetMapping("/number/{orderNumber}")
    public ResponseEntity<Order> getOrderByNumber(@PathVariable String orderNumber) {
        log.info("Getting order by number: {}", orderNumber);

        Optional<Order> order = orderService.getOrderByNumber(orderNumber);
        return order.map(ResponseEntity::ok)
                   .orElse(ResponseEntity.notFound().build());
    }
}

