                case "NOTIFICATION_READ":
                    handleNotificationRead(notification);
                    break;
                default:
                    log.warn("Unknown notification event type: {}", key);
            }
        } catch (Exception e) {
            log.error("Error processing notification event: {}", e.getMessage(), e);
        }
    }

