        log.info("Processing notification created event for notification: {}", notification.getId());




        log.info("Notification creation processing completed for: {}", notification.getId());
    }

    private void handleNotificationRead(Notification notification) {
        log.info("Processing notification read event for notification: {}", notification.getId());




        log.info("Notification read processing completed for: {}", notification.getId());
    }
}

