@Component
@RequiredArgsConstructor
@Slf4j
public class OrderEventConsumer {

    private final NotificationService notificationService;

    @KafkaListener(topics = "order-events", groupId = "order-consumer-group")
    public void handleOrderEvent(@Payload Order order, 
                                @Header(KafkaHeaders.RECEIVED_TOPIC) String topic,
                                @Header(KafkaHeaders.RECEIVED_KEY) String key) {

        log.info("Received order event: {} for order: {} from topic: {}", 
                key, order.getOrderNumber(), topic);

        try {
            switch (key) {
                case "ORDER_CREATED":
                    handleOrderCreated(order);
                    break;
                case "ORDER_STATUS_CHANGED":
                    handleOrderStatusChanged(order);
                    break;
                case "PAYMENT_PROCESSED":
                    handlePaymentProcessed(order);
                    break;
                default:
                    log.warn("Unknown order event type: {}", key);
            }
        } catch (Exception e) {
            log.error("Error processing order event: {}", e.getMessage(), e);
        }
    }

    private void handleOrderCreated(Order order) {
        log.info("Processing order created event for order: {}", order.getOrderNumber());


        notificationService.sendOrderNotification(
                order.getUser(), 
                order, 
                String.format("Your order %s has been created successfully", order.getOrderNumber())
        );


        log.info("Order creation processing completed for: {}", order.getOrderNumber());
    }

    private void handleOrderStatusChanged(Order order) {
        log.info("Processing order status changed event for order: {}", order.getOrderNumber());


        notificationService.sendOrderNotification(
                order.getUser(), 
                order, 
                String.format("Your order %s status has been updated to %s", 
                        order.getOrderNumber(), order.getStatus())
        );


        log.info("Order status change processing completed for: {}", order.getOrderNumber());
    }

    private void handlePaymentProcessed(Order order) {
        log.info("Processing payment processed event for order: {}", order.getOrderNumber());


        notificationService.sendPaymentNotification(
                order.getUser(), 
                order, 
                String.format("Payment for order %s has been %s", 
                        order.getOrderNumber(), order.getPaymentStatus())
        );


        log.info("Payment processing completed for: {}", order.getOrderNumber());
    }
}

