@Component
@RequiredArgsConstructor
@Slf4j
public class EventPublisher {

    private final ApplicationEventPublisher applicationEventPublisher;

    public void publishEvent(Object event) {
        log.info("Publishing event: {}", event.getClass().getSimpleName());
        applicationEventPublisher.publishEvent(event);
    }

    public void publishOrderEvent(String eventType, Object orderData) {
        OrderEvent orderEvent = new OrderEvent(this, eventType, orderData);
        publishEvent(orderEvent);
    }

    public void publishUserEvent(String eventType, Object userData) {
        UserEvent userEvent = new UserEvent(this, eventType, userData);
        publishEvent(userEvent);
    }

    public void publishNotificationEvent(String eventType, Object notificationData) {
        NotificationEvent notificationEvent = new NotificationEvent(this, eventType, notificationData);
