@Service
@RequiredArgsConstructor
@Slf4j
public class NotificationService {

    private final NotificationRepository notificationRepository;
    private final KafkaTemplate<String, Object> kafkaTemplate;

    @Transactional
    @LogExecutionTime
    public Notification createNotification(User user, String title, String message,
                                         Notification.NotificationType type, String metadata) {
        log.info("Creating notification for user: {}", user.getId());

        Notification notification = Notification.builder()
                .user(user)
                .title(title)
                .message(message)
                .type(type)
                .status(Notification.NotificationStatus.UNREAD)
                .metadata(metadata)
                .createdAt(LocalDateTime.now())
                .build();

        Notification savedNotification = notificationRepository.save(notification);


        publishNotificationEvent(savedNotification, "NOTIFICATION_CREATED");

        log.info("Notification created: {}", savedNotification.getId());
        return savedNotification;
    }

    public void sendOrderNotification(User user, Order order, String message) {
        String title = String.format("Order Update - %s", order.getOrderNumber());
        String metadata = String.format("{\"orderId\":%d,\"orderNumber\":\"%s\",\"status\":\"%s\"}", 
                order.getId(), order.getOrderNumber(), order.getStatus());

        createNotification(user, title, message, Notification.NotificationType.ORDER_UPDATE, metadata);
    }

    public void sendPaymentNotification(User user, Order order, String message) {
        String title = String.format("Payment Update - %s", order.getOrderNumber());
        String metadata = String.format("{\"orderId\":%d,\"orderNumber\":\"%s\",\"paymentStatus\":\"%s\"}", 
                order.getId(), order.getOrderNumber(), order.getPaymentStatus());

        createNotification(user, title, message, Notification.NotificationType.PAYMENT_CONFIRMATION, metadata);
    }

    public void sendSystemAlert(User user, String title, String message) {
        createNotification(user, title, message, Notification.NotificationType.SYSTEM_ALERT, null);
    }

    @Transactional
    public Notification markAsRead(Long notificationId) {
        log.info("Marking notification as read: {}", notificationId);

        Notification notification = notificationRepository.findById(notificationId)
                .orElseThrow(() -> new RuntimeException("Notification not found"));

        notification.setStatus(Notification.NotificationStatus.READ);
        Notification savedNotification = notificationRepository.save(notification);


        publishNotificationEvent(savedNotification, "NOTIFICATION_READ");

        return savedNotification;
    }

    public List<Notification> getNotificationsByUser(Long userId) {
        return notificationRepository.findByUserId(userId);
    }

    public List<Notification> getUnreadNotificationsByUser(Long userId) {
        return notificationRepository.findByUserIdAndStatus(userId, Notification.NotificationStatus.UNREAD);
    }

    public Long getUnreadNotificationCount(Long userId) {
        return notificationRepository.countUnreadNotificationsByUserId(userId);
    }

    private void publishNotificationEvent(Notification notification, String eventType) {
        try {
            kafkaTemplate.send("notification-events", eventType, notification);
            log.info("Published notification event: {} for notification: {}", eventType, notification.getId());
        } catch (Exception e) {
            log.error("Failed to publish notification event: {}", e.getMessage());
        }
    }
}

