@Service
@RequiredArgsConstructor
@Slf4j
public class OrderService {

    private final OrderRepository orderRepository;
    private final UserRepository userRepository;
    private final ProductRepository productRepository;
    private final ServiceFactory serviceFactory;
    private final KafkaTemplate<String, Object> kafkaTemplate;
    private final NotificationService notificationService;

    @Transactional
    @LogExecutionTime
    public Order createOrder(Long userId, List<Long> productIds, List<Integer> quantities) {
        log.info("Creating order for user: {}", userId);

        User user = userRepository.findById(userId)
                .orElseThrow(() -> new RuntimeException("User not found"));

        Order order = Order.builder()
                .orderNumber(serviceFactory.generateOrderNumber())
                .user(user)
                .status(Order.OrderStatus.PENDING)
                .paymentStatus(Order.PaymentStatus.PENDING)
                .totalAmount(BigDecimal.ZERO)
                .build();

        BigDecimal totalAmount = BigDecimal.ZERO;

        for (int i = 0; i < productIds.size(); i++) {
            Product product = productRepository.findById(productIds.get(i))
                    .orElseThrow(() -> new RuntimeException("Product not found"));

            Integer quantity = quantities.get(i);

            if (product.getStockQuantity() < quantity) {
                throw new RuntimeException("Insufficient stock for product: " + product.getName());
            }

            BigDecimal itemTotal = product.getPrice().multiply(BigDecimal.valueOf(quantity));
            totalAmount = totalAmount.add(itemTotal);

            OrderItem orderItem = OrderItem.builder()
                    .order(order)
                    .product(product)
                    .quantity(quantity)
                    .unitPrice(product.getPrice())
                    .totalPrice(itemTotal)
                    .build();

            order.getOrderItems().add(orderItem);


            product.setStockQuantity(product.getStockQuantity() - quantity);
            productRepository.save(product);
        }

        order.setTotalAmount(totalAmount);


        PricingStrategy pricingStrategy = serviceFactory.getPricingStrategy(user, order);
        BigDecimal finalAmount = pricingStrategy.calculatePrice(order, user);
        order.setTotalAmount(finalAmount);

        Order savedOrder = orderRepository.save(order);


        createOrderEvent(savedOrder, OrderEvent.EventType.ORDER_CREATED, "Order created successfully");


        publishOrderEvent(savedOrder, "ORDER_CREATED");


        notificationService.sendOrderNotification(user, savedOrder, "Order created successfully");

        log.info("Order created successfully: {}", savedOrder.getOrderNumber());
        return savedOrder;
    }

    @Transactional
    public Order updateOrderStatus(Long orderId, Order.OrderStatus newStatus) {
        log.info("Updating order status for order: {} to {}", orderId, newStatus);

        Order order = orderRepository.findById(orderId)
                .orElseThrow(() -> new RuntimeException("Order not found"));

        Order.OrderStatus oldStatus = order.getStatus();
        order.setStatus(newStatus);

        Order savedOrder = orderRepository.save(order);


        createOrderEvent(savedOrder, OrderEvent.EventType.STATUS_CHANGED,
                String.format("Status changed from %s to %s", oldStatus, newStatus));


        publishOrderEvent(savedOrder, "ORDER_STATUS_CHANGED");


        notificationService.sendOrderNotification(order.getUser(), savedOrder,
                String.format("Order status updated to %s", newStatus));

        return savedOrder;
    }

    @Transactional
    public Order processPayment(Long orderId, Order.PaymentStatus paymentStatus) {
        log.info("Processing payment for order: {} with status: {}", orderId, paymentStatus);

        Order order = orderRepository.findById(orderId)
                .orElseThrow(() -> new RuntimeException("Order not found"));

        order.setPaymentStatus(paymentStatus);

        if (paymentStatus == Order.PaymentStatus.PAID) {
            order.setStatus(Order.OrderStatus.CONFIRMED);
        }

        Order savedOrder = orderRepository.save(order);


        createOrderEvent(savedOrder, OrderEvent.EventType.PAYMENT_PROCESSED,
                String.format("Payment status: %s", paymentStatus));


        publishOrderEvent(savedOrder, "PAYMENT_PROCESSED");


        notificationService.sendOrderNotification(order.getUser(), savedOrder,
                String.format("Payment %s", paymentStatus));

        return savedOrder;
    }

    public List<Order> getOrdersByUser(Long userId) {
        return orderRepository.findByUserId(userId);
    }

    public List<Order> getOrdersByStatus(Order.OrderStatus status) {
        return orderRepository.findByStatus(status);
    }

    public Optional<Order> getOrderByNumber(String orderNumber) {
        return orderRepository.findByOrderNumber(orderNumber);
    }

    private void createOrderEvent(Order order, OrderEvent.EventType eventType, String eventData) {
        OrderEvent event = OrderEvent.builder()
                .order(order)
                .eventType(eventType)
                .eventData(eventData)
                .source("ORDER_SERVICE")
                .timestamp(LocalDateTime.now())
                .build();

        order.getEvents().add(event);
    }

    private void publishOrderEvent(Order order, String eventType) {
        try {
            kafkaTemplate.send("order-events", eventType, order);
            log.info("Published order event: {} for order: {}", eventType, order.getOrderNumber());
        } catch (Exception e) {
            log.error("Failed to publish order event: {}", e.getMessage());
        }
    }
}

