                String.format("Payment status: %s", paymentStatus));


        publishOrderEvent(savedOrder, "PAYMENT_PROCESSED");


        notificationService.sendOrderNotification(order.getUser(), savedOrder,
                String.format("Payment %s", paymentStatus));

        return savedOrder;
    }

public List<Order> getOrdersByUser(Long userId) {
        return orderRepository.findByUserId(userId);
    }

public List<Order> getOrdersByStatus(Order.OrderStatus status) {
        return orderRepository.findByStatus(status);
    }

public Optional<Order> getOrderByNumber(String orderNumber) {
        return orderRepository.findByOrderNumber(orderNumber);
    }

private void createOrderEvent(Order order, OrderEvent.EventType eventType, String eventData) {
        OrderEvent event = OrderEvent.builder()
                .order(order)
                .eventType(eventType)
                .eventData(eventData)
                .source("ORDER_SERVICE")
                .timestamp(LocalDateTime.now())
                .build();

        order.getEvents().add(event);
    }

private void publishOrderEvent(Order order, String eventType) {
        try {
            kafkaTemplate.send("order-events", eventType, order);
            log.info("Published order event: {} for order: {}", eventType, order.getOrderNumber());
        } catch (Exception e) {
            log.error("Failed to publish order event: {}", e.getMessage());
        }
    }

