@Component
public class BulkPricingStrategy implements PricingStrategy {

    private static final BigDecimal BULK_DISCOUNT = new BigDecimal("0.10"); 
    private static final BigDecimal BULK_THRESHOLD = new BigDecimal("1000.00");

    @Override
    public BigDecimal calculatePrice(Order order, User user) {
        BigDecimal originalAmount = order.getTotalAmount();

        if (originalAmount.compareTo(BULK_THRESHOLD) >= 0) {
            BigDecimal discount = originalAmount.multiply(BULK_DISCOUNT);
            return originalAmount.subtract(discount);
        }

        return originalAmount;
    }

    @Override
    public String getStrategyName() {
        return "BULK";
    }

    @Override
    public boolean isApplicable(User user, Order order) {
        return order.getTotalAmount().compareTo(BULK_THRESHOLD) >= 0;
    }
}

