public interface PricingStrategy {

    BigDecimal calculatePrice(Order order, User user);

    String getStrategyName();

    boolean isApplicable(User user, Order order);
}

@Component
public class StandardPricingStrategy implements PricingStrategy {

    @Override
    @LogExecutionTime
    public BigDecimal calculatePrice(Order order, User user) {
        return order.getTotalAmount();
    }

    @Override
    public String getStrategyName() {
        return "STANDARD";
    }

    @Override
    public boolean isApplicable(User user, Order order) {
        return user.getRole() == User.UserRole.CUSTOMER || user.getRole() == User.UserRole.GUEST;
    }
}

